import React from 'react';

const FinancialReport = () => {
  return (
    <div>
      <h1>Chama Smart Financial Report</h1>
      <div className="card">
        <div className="card-body text-center py-5">
          <h5>Chama Smart Financial Report</h5>
          <p className="text-muted">
            Your Chama Smart financial reports will be displayed here once you have activity.
          </p>
        </div>
      </div>
    </div>
  );
};

export default FinancialReport;
